import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-header',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {
  isMenuOpen = false;

  toggleMenu(): void {
    this.isMenuOpen = !this.isMenuOpen;
  }

  closeMenu(): void {
    this.isMenuOpen = false;
  }

  scrollToSection(sectionId: string): void {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth', block: 'start' });
    }
    this.closeMenu();
  }
}
<header class="header">
  <nav class="navbar">
    <div class="nav-container">
      <div class="logo">
        <h1>Élégance</h1>
      </div>
      <ul class="nav-menu" [class.active]="isMenuOpen">
        <li><a (click)="scrollToSection('accueil')">Accueil</a></li>
        <li><a (click)="scrollToSection('services')">Services</a></li>
        <li><a (click)="scrollToSection('galerie')">Galerie</a></li>
        <li><a (click)="scrollToSection('tarifs')">Tarifs</a></li>
        <li><a (click)="scrollToSection('contact')">Contact</a></li>
      </ul>
      <div class="hamburger" [class.active]="isMenuOpen" (click)="toggleMenu()">
        <span></span>
        <span></span>
        <span></span>
      </div>
    </div>
  </nav>
</header>
